import React, { useEffect, useState } from "react";
import Loading from "../../components/utils/loading";
import './Home.css';
import { ObteneCondominioLogic } from "../../presentation/view-model/Anuncio.logic";

const Home = () => {
    const [loading, setLoading] = useState(false);
    const [guid, setGuid] = useState("");

    const handleClick = () => {
        ObteneCondominioLogic(selObteneCondominio, guid);
    }
    const selObteneCondominio = (error: Boolean, err: string, data: any) => {
        try {
            setLoading(false);
            window.location.href = "/" + data + "/comunidad"
        } catch (er) {
        }
    }
    useEffect(() => {
        if (localStorage.getItem("idCondominio"))
            window.location.href = "/" + localStorage.getItem("idCondominio") + "/comunidad"
    }, [])

    const handlechange = (e: any) => {
        setGuid(e.target.value);
    };

    return (
        <React.Fragment>
            {
                loading ?
                    <Loading />
                    :
                    <div>
                        <div className="w-100 pb-3 mb-3" style={{ background: '#E6F4EA', justifyContent: 'center', display: 'grid', boxShadow: '0px 0px 24px 0px #5d8067' }}>
                            <img className="w-50 mx-auto" alt="Logo" src="data:image/jpeg;base64," />
                            <h2 className="text-center" style={{ color: '#656565', margin: '0' }}>Condominios</h2>
                        </div>
                        <div className="search-container">
                            <label htmlFor="textfield" className="search-label">
                                Ingrese el código de su comunidad:
                            </label>
                            <div className="search-box">
                                <input
                                    onChange={handlechange}
                                    type="text"
                                    id="textfield"
                                    className="search-input"
                                    placeholder="Escriba aquí..."
                                />
                                <button
                                    type="button"
                                    className="search-button"
                                    onClick={handleClick}
                                >
                                    Ingresar
                                </button>
                            </div>
                        </div>
                    </div>
            }
        </React.Fragment>
    );
}

export default Home;